// src/components/NiveisList.js
import React from 'react';

function NiveisList({ niveis, onEdit, onDelete }) {
  return (
    <div>
      <h2>Lista de Níveis</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nível</th>
          </tr>
        </thead>
        <tbody>
          {niveis.map(nivel => (
            <tr key={nivel.id}>
              <td>{nivel.id}</td>
              <td>{nivel.nivel}</td>
              <td>
                <button onClick={() => onEdit(nivel.id)}>Editar</button>
                <button onClick={() => onDelete(nivel.id)}>Excluir</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default NiveisList;
